import styled from "styled-components";
import {Form} from "./Form";
import { TodoList } from "./TodoList";

export const TodoPage = () => {
    return  (
        <div>
            <NavContainer>
                <Form />
                <TodoList />
            </NavContainer>
        </div>
    )
}

const NavContainer = styled.div`
    display: flex;
    align-items: center;
    width: 100vw;
    height: 100vh;
    font-family: Arial, Helvetica, sans-serif;
    padding: 10px;
`
